import React, { useState } from "react";
import Chart from "../steps/chart";
import Select from "react-select";
import "./frame.css";
import FrameIndicator from "./frame-indicator";

const Frame = (props) => {
  const [frameCollapsed, setFrameCollapsed]=useState(false); 
  return (
    <div className={`${frameCollapsed ? 'collapse' : ''} row`}>
     <button className="btn btn-primary" onClick={() => setFrameCollapsed(!frameCollapsed)}>
            Toggle collapse
        </button>
      <FrameIndicator />
      
    </div>
  );
};
export default Frame;
